  [],\n\t\"revision_timestamp\": \"2016-01-01T13:40:39.125267\",\n\t\"name\": \"preliminary-census-of-black-tern-breeding-populations-in-vermont-1990\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this report and this study
  is to determine the size, location, and viability of Black Tern nesting colonies
  in Missisquoi National Wildlife Refuge and other known breeding colonies in Vermont.
  Black Terns are rare in Vermont, and because they nest in small groups in marshes
  it is difficult to estimate their population size. Because of this there are no
  good estimates of the size of the breeding population, or whether their numbers
  are increasing or decreasing. Missisquoi National Wildlife Refuge appears to be
  one of the major breeding areas for Black Terns in Vermont. With accurate census
  data it will be possible to determine if active management is warranted to preserve
  the presence of this species in Vermont.\",\n\t\"license_title\": \"License Not
